import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const DealDetail = () => {
    const { id } = useParams();
    const [deal, setDeal] = useState(null);

    useEffect(() => {
        axios.get(`http://localhost:8080/api/deals/${id}`)
            .then(response => setDeal(response.data))
            .catch(error => console.error('Error fetching deal:', error));
    }, [id]);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setDeal({ ...deal, [name]: value });
    };

    const handleSubmit = () => {
        axios.put(`http://localhost:8080/api/deals/${id}`, deal)
            .then(response => console.log("Deal updated"))
            .catch(error => console.error('Error updating deal:', error));
    };

    if (!deal) {
        return <div>Loading...</div>;
    }

    return (
        <div className="deal-detail">
            <h2>{deal.name}</h2>
            <p>Amount: {deal.amount}</p>
            <p>Stage: {deal.stage.name}</p>

            {deal.stage.name === "Order Review" && (
                <div>
                    <label>Order Review Approved:
                        <input
                            type="checkbox"
                            name="orderReviewApproved"
                            checked={deal.orderReviewApproved || false}
                            onChange={handleInputChange}
                        />
                    </label>
                </div>
            )}

            {deal.stage.name === "Order Approved" && (
                <div>
                    <label>Local Order Placeholder:
                        <input
                            type="text"
                            name="localOrderPlaceholder"
                            value={deal.localOrderPlaceholder || ''}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>Customer Questionnaire Completed:
                        <input
                            type="checkbox"
                            name="customerQuestionnaireCompleted"
                            checked={deal.customerQuestionnaireCompleted || false}
                            onChange={handleInputChange}
                        />
                    </label>
                </div>
            )}

            {deal.stage.name === "Scheduled Confirmed" && (
                <div>
                    <label>Schedule Confirmed:
                        <input
                            type="checkbox"
                            name="scheduleConfirmed"
                            checked={deal.scheduleConfirmed || false}
                            onChange={handleInputChange}
                        />
                    </label>
                </div>
            )}

            {deal.stage.name === "Delivery and Install Complete" && (
                <div>
                    <label>Billing Complete:
                        <input
                            type="checkbox"
                            name="billingComplete"
                            checked={deal.billingComplete || false}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>Funding Complete:
                        <input
                            type="checkbox"
                            name="fundingComplete"
                            checked={deal.fundingComplete || false}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>Submitted for Payroll:
                        <input
                            type="checkbox"
                            name="submittedForPayroll"
                            checked={deal.submittedForPayroll || false}
                            onChange={handleInputChange}
                        />
                    </label>
                    <label>Pending Final Approval:
                        <input
                            type="checkbox"
                            name="pendingFinalApproval"
                            checked={deal.pendingFinalApproval || false}
                            onChange={handleInputChange}
                        />
                    </label>
                </div>
            )}

            {deal.stage.name === "Being Paid" && (
                <div>
                    <label>Being Paid:
                        <input
                            type="checkbox"
                            name="beingPaid"
                            checked={deal.beingPaid || false}
                            onChange={handleInputChange}
                        />
                    </label>
                </div>
            )}

            <button onClick={handleSubmit}>Save Changes</button>
        </div>
    );
};

export default DealDetail;
